DECLARE
    v_event_id TEXT;
    v_ticket_definition_id TEXT;
    v_ticket_count INTEGER := 0;
BEGIN
    -- Get event ID and ticket definition ID for the first ticket
    SELECT "eventId", "ticketDefinitionId" INTO v_event_id, v_ticket_definition_id
    FROM public."Tickets"
    WHERE "reservationId" = p_reservation_id
    AND "status" = 'reserved'
    LIMIT 1;

    -- If no tickets found, return false
    IF v_event_id IS NULL OR v_ticket_definition_id IS NULL THEN
        RETURN FALSE;
    END IF;

    -- Count the number of tickets to cancel
    SELECT COUNT(*) INTO v_ticket_count
    FROM public."Tickets"
    WHERE "reservationId" = p_reservation_id
    AND "status" = 'reserved';

    -- If no tickets to cancel, return false
    IF v_ticket_count = 0 THEN
        RETURN FALSE;
    END IF;

    -- Update tickets to mark them as available again
    UPDATE public."Tickets"
    SET 
        "status" = 'available',
        "reservationId" = NULL,
        "reservationExpiresAt" = NULL,
        "updatedAt" = now()
    WHERE "reservationId" = p_reservation_id
    AND "status" = 'reserved';

    -- Update EventTickets counts
    UPDATE public."EventTickets"
    SET 
        "availableCount" = "availableCount" + v_ticket_count,
        "reservedCount" = "reservedCount" - v_ticket_count,
        "updatedAt" = now()
    WHERE "eventId" = v_event_id 
      AND "ticketDefinitionId" = v_ticket_definition_id;

    RETURN TRUE;
EXCEPTION WHEN OTHERS THEN
    RAISE EXCEPTION 'Error in cancel_reservation: %', SQLERRM;
END;

