DECLARE
    v_ticket_id TEXT;
    v_event_id TEXT;
    v_ticket_definition_id TEXT;
    v_ticket_count INTEGER := 0;
BEGIN
    -- Validate that reservation exists and is not expired
    IF NOT EXISTS (
        SELECT 1 FROM public."Tickets"
        WHERE "reservationId" = p_reservation_id
        AND "status" = 'reserved'
        AND "reservationExpiresAt" > now()
    ) THEN
        RAISE EXCEPTION 'Invalid or expired reservation ID: %', p_reservation_id;
    END IF;

    -- Get event ID and ticket definition ID for the first ticket
    SELECT "eventId", "ticketDefinitionId" INTO v_event_id, v_ticket_definition_id
    FROM public."Tickets"
    WHERE "reservationId" = p_reservation_id
    LIMIT 1;

    -- Update tickets to mark them as sold and associate with attendee
    FOR v_ticket_id IN
        SELECT "ticketId" FROM public."Tickets"
        WHERE "reservationId" = p_reservation_id
        AND "status" = 'reserved'
    LOOP
        UPDATE public."Tickets"
        SET 
            "status" = 'sold',
            "attendeeId" = p_attendee_id,
            "reservationExpiresAt" = NULL,
            "paymentStatus" = 'Paid',
            "purchasedAt" = now(),
            "updatedAt" = now()
        WHERE "ticketId" = v_ticket_id;

        v_ticket_count := v_ticket_count + 1;
        RETURN NEXT v_ticket_id;
    END LOOP;

    -- Update EventTickets counts
    IF v_event_id IS NOT NULL AND v_ticket_definition_id IS NOT NULL THEN
        UPDATE public."EventTickets"
        SET 
            "reservedCount" = "reservedCount" - v_ticket_count,
            "soldCount" = "soldCount" + v_ticket_count,
            "updatedAt" = now()
        WHERE "eventId" = v_event_id 
          AND "ticketDefinitionId" = v_ticket_definition_id;
    END IF;

    RETURN;
EXCEPTION WHEN OTHERS THEN
    RAISE EXCEPTION 'Error in complete_reservation: %', SQLERRM;
END;

DECLARE
  v_current_reserved INTEGER;
BEGIN
  -- Lock the row and get current reserved count
  SELECT reserved_count INTO v_current_reserved
  FROM "public"."event_capacity"
  WHERE event_id = p_event_id
  FOR UPDATE;

  IF v_current_reserved IS NULL THEN
    RAISE EXCEPTION 'Event capacity not initialized for event ID %', p_event_id;
  END IF;

  -- Ensure we don't confirm more than what's reserved
  p_quantity := LEAST(p_quantity, v_current_reserved);

  -- Update the counts
  UPDATE "public"."event_capacity"
  SET 
    reserved_count = reserved_count - p_quantity,
    sold_count = sold_count + p_quantity
  WHERE event_id = p_event_id;

  RETURN TRUE;
END;

DECLARE
  v_confirmation_number TEXT;
  v_counter INTEGER := 0;
  v_exists BOOLEAN;
BEGIN
  -- If confirmation number is already set, don't override it
  IF NEW.confirmation_number IS NOT NULL THEN
    RETURN NEW;
  END IF;

  -- Generate initial confirmation number
  v_confirmation_number := 'REG-' || UPPER(SUBSTRING(NEW.registration_id::text, 1, 8));

  -- Check if this confirmation number already exists
  LOOP
    SELECT EXISTS(
      SELECT 1 FROM registrations 
      WHERE confirmation_number = v_confirmation_number
      AND registration_id != NEW.registration_id
    ) INTO v_exists;

    -- If it doesn't exist, we're good
    IF NOT v_exists THEN
      EXIT;
    END IF;

    -- If it exists, add a counter suffix
    v_counter := v_counter + 1;
    v_confirmation_number := 'REG-' || UPPER(SUBSTRING(NEW.registration_id::text, 1, 6)) || '-' || v_counter;

    -- Safety check to prevent infinite loop
    IF v_counter > 99 THEN
      -- Use a timestamp-based fallback
      v_confirmation_number := 'REG-' || TO_CHAR(NOW(), 'YYMMDD') || '-' || SUBSTRING(MD5(NEW.registration_id::text), 1, 4);
      EXIT;
    END IF;
  END LOOP;

  NEW.confirmation_number := v_confirmation_number;
  RETURN NEW;
END;

