DECLARE
    v_available INT;
    v_total INT;
    v_available_percent NUMERIC;
BEGIN
    -- Get availability counts
    WITH counts AS (
        SELECT
            SUM(CASE WHEN status = 'available' THEN 1 ELSE 0 END) as available,
            COUNT(*) as total
        FROM tickets
        WHERE eventid = p_event_id
        AND ticketdefinitionid = p_ticket_definition_id
    )
    SELECT
        available,
        total
    INTO
        v_available,
        v_total
    FROM counts;

    -- If no tickets or no data, not high demand
    IF v_total = 0 THEN
        RETURN FALSE;
    END IF;

    -- Calculate percentage available
    v_available_percent := (v_available::NUMERIC / v_total) * 100;

    -- High demand if available percentage is below threshold
    RETURN v_available_percent <= p_threshold_percent;
END;

