DECLARE
  current_date DATE;
  day_number INTEGER := 1;
  day_name TEXT;
BEGIN
  -- Delete existing days for this event (using UUID for comparison)
  DELETE FROM public.event_days WHERE event_id = parent_id_uuid;

  -- Only continue if this is a multi-day event (using UUID for comparison)
  IF EXISTS (SELECT 1 FROM public.events WHERE id = parent_id_uuid AND is_multi_day = TRUE) THEN
    -- For each distinct date in child events, create a day record (using UUID for comparison)
    FOR current_date IN 
      SELECT DISTINCT date FROM public.events 
      WHERE parent_event_id = parent_id_uuid
      ORDER BY date
    LOOP
      -- Create day name based on day number and date
      day_name := 'Day ' || day_number || ' - ' || to_char(current_date, 'FMDay, FMMonth DD');

      -- Insert the day (using UUID)
      INSERT INTO public.event_days (event_id, date, day_number, name)
      VALUES (parent_id_uuid, current_date, day_number, day_name);

      day_number := day_number + 1;
    END LOOP;
  END IF;
END;

