DECLARE
    v_reservation_id UUID := gen_random_uuid();
    v_expires_at TIMESTAMPTZ := now() + (p_reservation_minutes * interval '1 minute');
    v_ticket_record RECORD;
    v_found_tickets INT := 0;
BEGIN
    -- Create a cursor to find available tickets
    FOR v_ticket_record IN 
        SELECT ticketid
        FROM tickets
        WHERE eventid = p_event_id
        AND ticketdefinitionid = p_ticket_definition_id
        AND status = 'available'
        AND reservation_id IS NULL
        LIMIT p_quantity
        FOR UPDATE SKIP LOCKED
    LOOP
        -- Update each ticket
        UPDATE tickets
        SET status = 'reserved',
            reservation_id = v_reservation_id,
            reservation_expires_at = v_expires_at
        WHERE ticketid = v_ticket_record.ticketid;

        -- Return ticket info
        ticket_id := v_ticket_record.ticketid;
        reservation_id := v_reservation_id;
        expires_at := v_expires_at;

        v_found_tickets := v_found_tickets + 1;

        RETURN NEXT;
    END LOOP;

    -- If we couldn't find enough tickets, rollback the reservation
    IF v_found_tickets < p_quantity THEN
        UPDATE tickets
        SET status = 'available',
            reservation_id = NULL,
            reservation_expires_at = NULL
        WHERE reservation_id = v_reservation_id;

