DECLARE
    v_reservation_id UUID := gen_random_uuid();
    v_expires_at TIMESTAMPTZ := now() + (p_reservation_minutes * interval '1 minute');
    v_ticket_record RECORD;
    v_found_tickets INT := 0;
    v_event_uuid UUID;
    v_ticket_def_uuid UUID;
BEGIN
    -- Try to convert string IDs to UUIDs or generate deterministic UUIDs from strings
    BEGIN
        v_event_uuid := p_event_id::UUID;
    EXCEPTION WHEN others THEN
        v_event_uuid := md5(p_event_id)::uuid;
    END;
    BEGIN
        v_ticket_def_uuid := p_ticket_definition_id::UUID;
    EXCEPTION WHEN others THEN
        v_ticket_def_uuid := md5(p_ticket_definition_id)::uuid;
    END;

    -- Create a cursor to find available tickets - Using camelCase column names
    -- Note the alias for v_ticket_record to access it easily later
    FOR v_ticket_record IN
        SELECT "ticketId" as record_ticket_id -- Alias needed as "ticketId" is quoted
        FROM public."Tickets"
        WHERE "eventId" = v_event_uuid
        AND "ticketDefinitionId" = v_ticket_def_uuid
        AND status = 'available'
        AND "reservationId" IS NULL -- Use camelCase
        LIMIT p_quantity
        FOR UPDATE SKIP LOCKED
    LOOP
        -- Update each ticket - Using camelCase column names
        UPDATE public."Tickets"
        SET status = 'reserved',
            "reservationId" = v_reservation_id, -- Use camelCase
            "reservationExpiresAt" = v_expires_at -- Use camelCase
        WHERE "ticketId" = v_ticket_record.record_ticket_id; -- Use the alias

        -- Return ticket info
        ticket_id := v_ticket_record.record_ticket_id; -- Use the alias
        reservation_id := v_reservation_id; -- This is the function's output column name
        expires_at := v_expires_at;
        v_found_tickets := v_found_tickets + 1;
        RETURN NEXT;
    END LOOP;

    -- If we couldn't find enough tickets, rollback the reservation
    IF v_found_tickets < p_quantity THEN
        UPDATE public."Tickets"
        SET status = 'available',
            "reservationId" = NULL, -- Use camelCase
            "reservationExpiresAt" = NULL -- Use camelCase
        WHERE "reservationId" = v_reservation_id; -- Use camelCase
        RAISE EXCEPTION 'Not enough tickets available. Requested: %, Found: %', p_quantity, v_found_tickets;
    END IF;

    RETURN;
END;

DECLARE
    v_reservation_id TEXT := gen_random_uuid()::TEXT;
    v_expiry TIMESTAMP WITH TIME ZONE := now() + (p_reservation_minutes * INTERVAL '1 minute');
    v_available_count INTEGER;
    v_ticket_id TEXT;
    v_price NUMERIC(10,2);
    v_event_exists BOOLEAN;
BEGIN
    -- Validate input
    IF p_quantity <= 0 THEN
        RAISE EXCEPTION 'Quantity must be greater than 0';
    END IF;

    RAISE NOTICE 'Reserving % tickets for event % and ticket definition %', 
        p_quantity, p_event_id, p_ticket_definition_id;

    -- Check if the event exists in either Events or events table
    SELECT EXISTS (
        SELECT 1 FROM public."Events" WHERE "id" = p_event_id
    ) INTO v_event_exists;

    IF NOT v_event_exists THEN
        -- Try lowercase table
        SELECT EXISTS (
            SELECT 1 FROM public.events WHERE id = p_event_id
        ) INTO v_event_exists;
    END IF;

    IF NOT v_event_exists THEN
        RAISE NOTICE 'Event with ID % not found in either Events or events table', p_event_id;
    END IF;

    -- Start by checking if we already have an EventTickets record
    BEGIN
        SELECT "availableCount", "price" INTO v_available_count, v_price
        FROM public."EventTickets"
        WHERE "eventId" = p_event_id 
          AND "ticketDefinitionId" = p_ticket_definition_id
          AND "status" = 'Active';
    EXCEPTION WHEN OTHERS THEN
        RAISE NOTICE 'Error finding EventTickets record: %', SQLERRM;
    END;

    -- If no EventTickets record found, try to create one with default values
    IF v_available_count IS NULL THEN
        -- Try to get price from TicketDefinitions
        BEGIN
            SELECT "price" INTO v_price
            FROM public."TicketDefinitions"
            WHERE "ticketDefinitionId" = p_ticket_definition_id;
        EXCEPTION WHEN OTHERS THEN
            RAISE NOTICE 'Error finding TicketDefinition: %', SQLERRM;
        END;

        -- If still no price, check for a slug field match
        IF v_price IS NULL THEN
            BEGIN
                -- Check if slug column exists
                IF EXISTS (
                    SELECT 1 FROM information_schema.columns 
                    WHERE table_name = 'TicketDefinitions' 
                    AND column_name = 'slug'
                ) THEN
                    SELECT "price" INTO v_price
                    FROM public."TicketDefinitions"
                    WHERE "slug" = p_ticket_definition_id;
                END IF;
            EXCEPTION WHEN OTHERS THEN
                RAISE NOTICE 'Error checking for slug: %', SQLERRM;
            END;
        END IF;

        -- Set default price if still null
        IF v_price IS NULL THEN
            v_price := 0.00;
        END IF;

        -- Create new EventTickets record with default capacity
        BEGIN
            INSERT INTO public."EventTickets" (
                "eventId", 
                "ticketDefinitionId", 
                "totalCapacity", 
                "availableCount", 
                "price",
                "status"
            )
            VALUES (
                p_event_id,
                p_ticket_definition_id,
                1000, -- Default capacity
                1000, -- Default available
                v_price,
                'Active'
            )
            RETURNING "availableCount" INTO v_available_count;

            RAISE NOTICE 'Created new EventTickets record with availableCount: %', v_available_count;
        EXCEPTION WHEN OTHERS THEN
            RAISE EXCEPTION 'Error creating EventTickets record: %', SQLERRM;
        END;
    END IF;

    -- Check if enough tickets are available
    IF v_available_count < p_quantity THEN
        RAISE EXCEPTION 'Not enough tickets available. Requested: %, Available: %', 
            p_quantity, v_available_count;
    END IF;

    -- Update EventTickets to mark tickets as reserved
    BEGIN
        UPDATE public."EventTickets"
        SET 
            "availableCount" = "availableCount" - p_quantity,
            "reservedCount" = "reservedCount" + p_quantity,
            "updatedAt" = now()
        WHERE "eventId" = p_event_id 
          AND "ticketDefinitionId" = p_ticket_definition_id;

        RAISE NOTICE 'Updated EventTickets inventory';
    EXCEPTION WHEN OTHERS THEN
        RAISE EXCEPTION 'Error updating EventTickets inventory: %', SQLERRM;
    END;

    -- Create tickets
    BEGIN
        FOR i IN 1..p_quantity LOOP
            v_ticket_id := gen_random_uuid()::TEXT;

            -- Insert new ticket
            INSERT INTO public."Tickets" (
                "ticketId",
                "eventId",
                "ticketDefinitionId",
                "status",
                "pricePaid",
                "reservationId",
                "reservationExpiresAt",
                "originalPrice",
                "paymentStatus"
            )
            VALUES (
                v_ticket_id,
                p_event_id,
                p_ticket_definition_id,
                'reserved',
                v_price,
                v_reservation_id,
                v_expiry,
                v_price,
                'Unpaid'
            );

            -- Output this ticket
            ticket_id := v_ticket_id;
            reservation_id := v_reservation_id;
            expires_at := v_expiry;
            RETURN NEXT;
        END LOOP;

        RAISE NOTICE 'Created % new tickets with reservation ID %', p_quantity, v_reservation_id;
    EXCEPTION WHEN OTHERS THEN
        RAISE EXCEPTION 'Error creating tickets: %', SQLERRM;
    END;

    RETURN;
EXCEPTION WHEN OTHERS THEN
    RAISE EXCEPTION 'Error in reserve_tickets_v3: % | eventId: % | ticketDefinitionId: %', 
        SQLERRM, p_event_id, p_ticket_definition_id;
END;

