DECLARE
  payment_intent_id TEXT;
  payment_status TEXT;
  payment_data JSON;
  payment_amount NUMERIC;
BEGIN
  -- Get the payment intent ID from the registration
  SELECT "stripePaymentIntentId" INTO payment_intent_id
  FROM public."Registrations"
  WHERE "registrationId" = reg_id;

  IF payment_intent_id IS NULL THEN
    RETURN json_build_object(
      'success', false,
      'error', 'No payment intent found for this registration'
    );
  END IF;

  -- Check the payment intent status in Stripe
  SELECT check_payment_intent_status(payment_intent_id) INTO payment_data;

  -- Extract the payment status
  SELECT payment_data->>'status' INTO payment_status;
  SELECT (payment_data->>'amount')::numeric INTO payment_amount;

  -- Update based on the status
  IF payment_status = 'succeeded' THEN
    UPDATE public."Registrations"
    SET status = 'paid',
        "paymentStatus" = 'completed',
        "totalAmountPaid" = payment_amount/100,
        "updatedAt" = NOW()
    WHERE "registrationId" = reg_id;

    -- Update related tickets
    UPDATE public."Tickets"
    SET status = 'confirmed',
        "updatedAt" = NOW()
    WHERE "registrationId" = reg_id;

    RETURN json_build_object(
      'success', true,
      'registrationId', reg_id,
      'status', 'paid',
      'paymentStatus', 'completed',
      'stripeStatus', payment_status,
      'amount', payment_amount/100
    );
  ELSE
    RETURN json_build_object(
      'success', false,
      'registrationId', reg_id,
      'status', 'pending',
      'stripeStatus', payment_status,
      'paymentData', payment_data
    );
  END IF;
END;

